import './App.css';
import React from 'react';

function App() {
  return (
    <>
    <Button/>
    <Button/>
    <NavBar/>
    <TextArea/>
    </>
  );
}

function Button() {
  return (
    <button
      onClick={() => console.log('click!')}
      >
      2
    </button>
  );
}

function TextArea() {
  return (
    <textarea></textarea>
  );
}

export default App;
